import React from 'react';
import { Link } from 'react-router-dom'

const Scenario = () => {
    return (
        <div className='col'>
            <div className='card'>
               <div className="card-body">
                 <h5 className="card-title">Okanagan Relocation</h5>
                 <p className="card-text">Move from Van to Kelowna.</p>
                 <Link to='/newScenario'><button type="submit" className="btn btn-primary ">Edit</button></Link>
               </div>
            </div>
        </div>
        )
    }

export default Scenario;
